      write(iwr,9010) 'WITH OUTPUT ARGUMENTS'
      write(iwr,9030) 'Epp    =', Epp
      call rprin0(be  , 1, nTM, 'be    ', iwr)
      call rprin0(Epl , 1,   3, 'Epl   ', iwr)
      call rprin0(Sig , 1,nSig, 'Sig   ', iwr)
      call rprin0(Cst , 6,   6, 'Cst   ', iwr)
