     &             1.0998000000000D+01, 6.4205464377994D+00,
     &             1.0999000000000D+01, 6.4209358859713D+00 /
C
      f1  = zero
      f2  = zero
      f3  = zero
      f11 = zero
      f22 = zero
      f33 = zero
      f12 = zero
      f13 = zero
      f23 = zero
C
      iYIELD = nint(pMAT(9))     ! Type of yield function
      Y0     = sqt23 * pMAT(10)  ! Radius of yield = sqrt(2/3) Sig_y
      Yinf   = sqt23 * pMAT(11)  ! Radius of yield = sqrt(2/3) Sig_inf
      beta   = pMAT(12)
      Hi     = sqt23 * pMAT(7)   ! Isotropic hardening = sqrt(2/3)*H_iso
      YY     = Y0 + Hi*Epp       ! Sig_y(t_n) yield stress
      Ypr    = two3 * pMAT(7)    ! Isotropic yield = 2/3 H_iso
      yield  =-YY                ! Default return = no yield
C
C     VON MISES YIELD FUNCTION
C
      if (iYIELD .eq. 1)                          then
C
         aa    = (Y0 - Yinf)*exp(-beta*Epp)
         YY    = Yinf + aa + Hi*Epp
         Ypr   = Ypr - sqt23*beta*aa
         ss    = sqrt( two * J2 )
         yield = ss - YY
         if (ipsw .gt. 0)                         then
            write(iwr,9010) 'LEAVING FUNCTION YFUNCT'
            if (ipsw .gt. 3)                      then
               write(iwr,9010) 'WITH INPUT ARGUMENTS'
               write(iwr,9030) 'Epp    =', Epp
               write(iwr,9010) 'WITH OUTPUT ARGUMENTS'
               write(iwr,9030) 'YY     =', YY
               write(iwr,9030) 'YPR    =', YPR
               write(iwr,9030) 'ss     =', ss
               write(iwr,9030) 'yield  =', yield
            endif
            call flush(iwr)
         endif
C
C       Compute yield function derivatives
C
         if (flg)                                 then
C
            if (ss .ne. zero)                     then
               f2  =   one / ss
               f22 = - f2**3
            end if
C
         end if
C
C     DRUCKER PRAGER YIELD FUNCTION
C
      else if (iYIELD .eq. 2)                     then
C
         aa    = Yinf
         ss    = sqrt( two * J2 )
         yield = ss + one3 * aa * I1 - YY
C
C       Compute yield function derivatives
C
         if (flg)                                 then
C
            f1 = one3 * aa
C
            if (ss .ne. zero)                     then
               f2  =   one / ss
               f22 = - f2**3
            end if
C
         end if
C
C     PRAGER-LODE YIELD FUNCTION
C
      else if (iYIELD .eq. 3)                     then
C
         if (J2 .gt. zero)                        then
C
            if (flg)                              then
C
C           Read in material parameters
C
               bb = sqt23*pMAT(11)! Radius of yield = sqrt(2/3) Sig_inf
C
C           Compute yield function
C
               c1 = one / sqrt(two)
               c2 = sqrt(13.5d0) * bb
C
C           yield   = J2 * ( one + bb * J3 * J2 **(-onep5)) - YY
               yield = ( sqrt(two*J2) + c2 * J3 / J2 ) - YY
C
C           Compute yield function derivatives
C
               J2_1  =   one / J2
               J2_2  =   J2_1**2
               J2_12 =   sqrt(J2_1)
C
               f2    =   c1 * J2_12            - c2 * J3 * J2_2
               f3    =                           c2      * J2_1
               f22   = - c1 * J2_12**3 * one2 + c2 * J3 * J2_1**3 * two
               f23   =                         - c2      * J2_2
C
            end if
C
         else
C
            yield = -YY
C
         end if
C
C     JOHNSON-COOK YIELD FUNCTION
C
      else if (iYIELD .eq. 4)                     then
C
         if (Epp .eq. zero)                       then
            YY  = Y0 
            Ypr = Ypr + sqt23*Yinf*(1.0d-4)**(beta-one)
         else
            YY  = Y0 + Yinf*(Epp**beta) + Hi*Epp
            Ypr = Ypr + sqt23*beta*Yinf*(Epp**(beta-one))
         end if
C
         ss     = sqrt( two * J2 )
         yield  = ss - YY
C
         if (ipsw .gt. 0)                         then
            write(iwr,9010) 'LEAVING FUNCTION YFUNCT'
            if (ipsw .gt. 3)                      then
               write(iwr,9010) 'WITH INPUT ARGUMENTS'
               write(iwr,9030) 'Epp    =', Epp
               write(iwr,9010) 'WITH OUTPUT ARGUMENTS'
               write(iwr,9030) 'YY     =', YY
               write(iwr,9030) 'YPR    =', YPR
               write(iwr,9030) 'ss     =', ss
               write(iwr,9030) 'yield  =', yield
            endif
            call flush(iwr)
         endif
C
C       Compute yield function derivatives
C
         if (flg)                                 then
C
            if (ss .ne. zero)                     then
               f2  =   one / ss
               f22 = - f2**3
            end if
C
         end if
C
C     PIECEWISE LINEAR ISOTROPIC HARDENING CURVE
C
      else if (iYIELD .eq. 5)                     then
C
         YY    = sqt23*plfun(Epp,nPOINT,Hcurve)
         Ypr   = Ypr + two3*dplfun(Epp,nPOINT,Hcurve)
         ss    = sqrt( two * J2 )
         yield = ss - YY
         if (ipsw .gt. 0)                         then
            write(iwr,9010) 'LEAVING FUNCTION YFUNCT'
            if (ipsw .gt. 3)                      then
               write(iwr,9010) 'WITH INPUT ARGUMENTS'
               write(iwr,9030) 'Epp    =', Epp
               write(iwr,9010) 'WITH OUTPUT ARGUMENTS'
               write(iwr,9030) 'YY     =', YY
               write(iwr,9030) 'YPR    =', YPR
               write(iwr,9030) 'dplfun =', dplfun(Epp,nPOINT,Hcurve)
               write(iwr,9030) 'ss     =', ss
               write(iwr,9030) 'yield  =', yield
            endif
            call flush(iwr)
         endif
C
C       Compute yield function derivatives
C
         if (flg)                                 then
C
            if (ss .ne. zero)                     then
               f2  =   one / ss
               f22 = - f2**3
            end if
C
         end if
C
      else
C
C     NO YIELD FUNCTION SPECIFIED
C
         yield = zero
         write (iwr,9000)
C
      end if
C
      yfunct = yield
C
      return
C
C     Format
C
 9000 format(' *** NO YIELD FUNCTION SPECIFIED ***')
 9010 format(3X,A)
 9020 format(3X,A,I6)
 9030 format(3X,A,3E15.6)
C
      end

      DOUBLE PRECISION FUNCTION DPLFUN(X, NPOINT, XFX)
C
      INTEGER NPOINT, I
      DOUBLE PRECISION X, XFX(2,NPOINT), R0
      DATA R0 / 0.0D0 /
C***********************************************************************
C DERIVATIVE OF THE PIECEWISE LINEAR FUNCTION 'PLFUN' DEFINED BY A SET
C OF NPOINT PAIRS {X,F(X)} STORED IN THE MATRIX XFX (DIM. 2*NPOINT).
C***********************************************************************
      DO 100 I=1,NPOINT 
        IF (X.GE.XFX(1,I)) THEN
          GOTO 100
        ELSE
          IF (I.EQ.1) THEN
C           -- x < x1   --> f(x)=f(x1) --> df(x)/dx=0 --- 
            DPLFUN=R0
            GOTO 999
          ELSE
C           -- x(i-1) <= x < x(i) ---
            DPLFUN=(XFX(2,I)-XFX(2,I-1))/
     1             (XFX(1,I)-XFX(1,I-1))
            GOTO 999
          ENDIF
        ENDIF
 100  CONTINUE
C     ---- x >= x(npoint) --> f(x) = f(x(npoint)) --> df/dx=0 ---
      DPLFUN=R0 
 999  CONTINUE
      RETURN
      END

      DOUBLE PRECISION FUNCTION PLFUN(X, NPOINT, XFX)
C
      INTEGER NPOINT, I
      DOUBLE PRECISION X, XFX(2,*)
C***********************************************************************
C PIECEWISE LINEAR FUNCTION DEFINED BY A SET OF NPOINT PAIRS
C {X,F(X)} STORED IN THE MATRIX XFX (DIM. 2*NPOINT).
C***********************************************************************
      DO 100 I=1,NPOINT 
        IF (X.GE.XFX(1,I)) THEN
          GOTO 100
        ELSE  
          IF (I.EQ.1) THEN
C           -- x < x1 --> f(x)=f(x1) --- 
            PLFUN=XFX(2,1)
            GOTO 999
          ELSE
C           -- x(i-1) <= x < x(i) ---
            PLFUN=XFX(2,I-1)+(X-XFX(1,I-1))*
     1                 (XFX(2,I)-XFX(2,I-1))/
     2                 (XFX(1,I)-XFX(1,I-1))
            GOTO 999
          ENDIF
        ENDIF
 100  CONTINUE
C     ----  x >= x(npoint) --> f(x) = f(x(npoint))  ---
      PLFUN=XFX(2,NPOINT)
 999  CONTINUE
      RETURN
      END
